import React from 'react';

const Avatarlist = () => {

    const Avatarlistarray = [
        {
            id: 1,
            name: 'Nitin Sharma',
            work: "Design Developer"
        },
        {
            id: 2,
            name: 'Amit',
            work: "Frontend Developer"
        },
        {
            id: 3,
            name: 'Laxman',
            work: "Backend Developer"
        },
        {
            id: 4,
            name: 'Abhishek',
            work: "Content Developer"
        }

    ]

    return (
        <div className="avtarStyle ma4 bg-light-purple dib pa4" >
            <img src={`https://joeschmoe.io/api/v1/${Avatarlistarray[0].name}`} alt="" />
            <h1>{Avatarlistarray[0].name}</h1>
            <p>{Avatarlistarray[0].work}</p>
        </div>
    )
}
export default Avatarlist;
